import React from "react";
import loadingGif from "../../assets/img/loading-arrow.gif";

const Loading = () => {
	return (
		<div className="loading">
			<h3>Nothing to show....</h3>
			<img src={loadingGif} alt=""/>
		</div>
	)
}

export default Loading
